import './Timeline.css';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";

const responsive = {
  superLargeDesktop: {
    // the naming can be any, depends on you.
    breakpoint: { max: 4000, min: 3000 },
    items: 5
  },
  desktop: {
    breakpoint: { max: 3000, min: 1024 },
    items: 3
  },
  tablet: {
    breakpoint: { max: 1024, min: 464 },
    items: 2
  },
  mobile: {
    breakpoint: { max: 464, min: 0 },
    items: 1
  }
};

const Card = (props) => (
  <div className={`timeline__card timeline__card--${props.type}`}>
    <span className="timeline__card-number">{props.number}</span>

    <div className="timeline__button-wrapper">
      <button className={`button-lg timeline__button--${props.type}`}>{props.cta}</button>
    </div>
  </div>
);

function Timeline() {
  return (
    <div className="timeline__bg">
      <Container>
        <Row>
          <Col xs={12} md={6}>
            <h2 className="timeline__heading heading1">Our Timeline</h2>
          </Col>
        </Row>
      </Container>

      <Carousel responsive={responsive}>
        <Card
          number='15'
          cta='Engineers'
          type='bottom'
        />
        <Card
          number='15'
          cta='Engineers'
          type='bottom'
        />
        <Card
          number='15'
          cta='Engineers'
          type='bottom'
        />
        <Card
          number='15'
          cta='Engineers'
          type='bottom'
        />
      </Carousel>;
    </div>
  );
}

export default Timeline;
